import React from 'react'

const About = () => {
  return (
    <div>
    <h1>About Our Application</h1>
    <p>We are developing an internet application system that includes a website management system allowing business users to publish content.</p>
    <p>The published content will be available in different sections depending on approval. Regular users will only be able to view the cards that are created.</p>
    <p>However, business users will have the ability to create cards for their work and distribute them.</p>
  </div>
  )
}

export default About
